import React, { Component } from 'react';



export default class NavBar extends Component {
    render(){
        return(
            <div>           
                <nav className="navbar navbar-expand-md navbar-dark bg-dark fixed-top" style={{
                
                 backgroundColor: "ef5350"   

                }}>
                    <a>MK11 Selector</a>
                </nav>
            </div>
        )      
    }   
}
